import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';


import { express } from 'express';

const app = express();

app.listen(3000, () =>
  console.log('Example app listening on port 3000!'),
);


ReactDOM.render(<App />, document.getElementById('root'));
